ControlPropertyState.AutoRuleBindingString:
Set(varElementoContratualSelect, true);
ClearCollect(colElementoContratualSelect, Filter(db_cont_econtratual, ID = ThisItem.ID));
UpdateContext({locPP_ElementoContratualSelect: First(colElementoContratualSelect)});

Filter(
    db_cont_econtratual,

    // Filtro 1: Texto do contrato
    IsBlank(TextInput1_8.Text) || StartsWith(n_contrato, TextInput1_8.Text),

    // Filtro 2: Objeto reduzido do contrato
    IsBlank(TextInput1_9.Text) || 
    n_contrato in 
        ShowColumns(
            Filter(
                db_cont_contrato,
                StartsWith(objeto_reduzido, TextInput1_9.Text)
            ),
            n_contrato
        )
)
